import { StyleSheet } from 'react-native';
import AppColors from './AppColors';

export default StyleSheet.create({
    mediumTitle: {
        fontSize: 23,
        color: AppColors.text,
        fontWeight: 700
    },
    column30: {
        paddingLeft: 30,
        paddingRight: 30,
    },
    groupLeft: {
        alignItems: 'left',
    },
    groupCenter: {
        alignItems: 'center',
    },
    inputLabel: {
        fontSize: 13,
        fontWeight: 600,
        color: AppColors.bodyText,
    },
    InputView: {
        backgroundColor: "#FFC0CB",
        borderRadius: 30,
        width: "70%",
        height: 45,
        marginBottom: 20,
        alignItems: "center",
    },
    TextInput: {
        height: 50,
        flex: 1,
        padding: 10,
        marginLeft: 20,
    }
});
